    render(){
        return(
            <Link to="/bot">
                <div className="Stylistinchief">

                <img src={CharacterImage} style={{marginTop:"8em"}} alt="Character" />
                <div>
                    <div class="bubble">!</div>
                    <div class="pointer"></div>
                </div>

                <div>
                    <div class="bubble blurred"></div>
                    <div class="pointer blurred"></div>
                </div>

                <button type="button" class="btn btn-outline-warning">Ask Me I'm Online</button>
                </div>

            </Link>

        )
    }
}
